import React, { useState } from 'react'
import { AgGridReact } from "ag-grid-react";
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-alpine-dark.css';
import Teams from '../Arrays/Teams'
import { AllCommunityModule, ModuleRegistry } from 'ag-grid-community'; 
import './Campionato.css'

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

ModuleRegistry.registerModules([AllCommunityModule]);

function createData(numberMatch, dateMatch, homeName, homeResult, awayResult, awayName) {
  return { numberMatch, dateMatch, homeName, homeResult, awayResult, awayName };
}

const rows = [
  createData(1, "17/10/2025 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "VALL'ALTA"),
  createData(2, "23/10/2025 21:30", "SCANZOROSCIATE", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(3, "31/10/2025 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "ASPO PONTOGLIO"),
  createData(4, "07/11/2025 21:30", "COLOGNOLA 46ERS", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(5, "14/11/2025 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "POTASCE' BASKET"),
  createData(6, "20/11/2025 21:15", "POL. VILLESE", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(7, "27/11/2025 21:15", "69ERS GRUMELLO", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(8, "05/12/2025 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "FERVENS VERTOVA"),
  createData(9, "11/12/2025 21:30", "BOCA LIONS 89", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(10, "19/12/2025 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "SEBINO BASKET"),
  createData(11, "Riposo", "Riposo", "- -", "- -", "Riposo"),
  createData(12, "30/01/2026 21:30", "VALL'ALTA", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(13, "06/02/2026 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "SCANZOROSCIATE"),
  createData(14, "13/02/2026 20:45", "ASPO PONTOGLIO", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(15, "20/02/2026 20:45", "D.O.C. SERIANA COBRAS", "- -", "- -", "COLOGNOLA 46ERS"),
  createData(16, "27/02/2026 21:15", "POTASCE' BASKET", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(17, "06/03/2026 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "POL. VILLESE"),
  createData(18, "13/03/2026 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "69ERS GRUMELLO"),
  createData(19, "19/03/2026 21:00", "FERVENS VERTOVA", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(20, "27/03/2026 20:30", "D.O.C. SERIANA COBRAS", "- -", "- -", "BOCA LIONS 89"),
  createData(21, "08/04/2026 21:30", "SEBINO BASKET", "- -", "- -", "D.O.C. SERIANA COBRAS"),
  createData(22, "Riposo", "Riposo", "- -", "- -", "Riposo"),
];

const Campionato = () => {

const [rowData, setRowData] = useState(Teams);

  const [colDefs, setColDefs] = useState([
  { field: "position" },
  { field: "name" },
  { field: "points"}
]); 

const defaultColDef = {
    flex: 1,
};

  return (
    <div className='campionato'>
      <h1>Leaderboard / Results</h1>
      <div className="ag-theme-alpine-dark classifica-tabella" style={{ width: '100%', height: '600px' }}>
        <AgGridReact
          rowData={rowData}
          columnDefs={colDefs}
          defaultColDef={{
            flex: 1,
            minWidth: 100,
            sortable: true,
            resizable: true,
            cellStyle: { textAlign: 'center', fontFamily: 'Poppins, sans-serif', fontSize: '15px' }
          }}
        />
      </div>
      <div className='results-table'>
        <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Match</TableCell>
              <TableCell align="center">Date</TableCell>
              <TableCell align="center">Home</TableCell>
              <TableCell align="center">Home points</TableCell>
              <TableCell align="center">Away points</TableCell>
              <TableCell align="center">Away</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow
                key={row.name}
                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
              >
                    <TableCell component="th" scope="row">
                      {row.numberMatch}
                    </TableCell>
                    <TableCell align="center">{row.dateMatch}</TableCell>
                    <TableCell align="center">{row.homeName}</TableCell>
                    <TableCell align="center">{row.homeResult}</TableCell>
                    <TableCell align="center">{row.awayResult}</TableCell>
                    <TableCell align="center">{row.awayName}</TableCell>
                  </TableRow>
                ))}
            </TableBody>
          </Table>
          </TableContainer>
        </div>
    </div>
  )
}

export default Campionato
